Prorrogação dos prazos de execução do Termo de Convênio N° 007/2011/0001 em 66 (sessenta e seis) dias e do prazo de vigência em 64 (sessenta e quatro) dias, passando o prazo de execução do objeto de 30/09/2012 para 05/12/2012 e o prazo de vigência de 31/12/2012 para 05/03/2013;

1.1.2    Adequação dos quantitativos inicialmente previstos em relação à execução físico-financeira do Termo de Convênio, considerando a realização do 1º aditamento ao Instrumento Contratual nº 003/2012/00/00-SECID - TA nº 003/2012/01/01 – SECID (Processo nº 394694/2012-SECID);

1.1.3   Incluir no Termo de Convênio N° 007/2012/0001 as seguintes informações relativas ao Plano de Investimentos e Código Orçamentário: Item do Plano de Ação: 15582, Código Orçamentário: Dependência: 019, Conta: 218070010, Centro de Custos: 201309.

Tem por objeto a inclusão do seguinte item 2.4.2 no Termo de Convênio:
“CLÁUSULA SEGUNDA - VALOR E PARTICIPAÇÃO FINANCEIRA DAS PARTES
“2.4.2 – Estão incluídas nas obras e serviços de engenharia de adequação do sistema viário de acesso ao AEROPORTO, a cargo do ESTADO:
“a) as obras do Sistema de Veículos Leves sobre Trilhos (VLT) e obras, reparos ou realocações de objetos ou equipamentos, localizados nas áreas a serem cedidas pelo AEROPORTO, cuja cessão, doação ou outra ação patrimonial será objeto de decisão futura em processo específico, e em andamento;
“b) as obras de infraestrutura de drenagem de águas pluviais e esgotamento sanitário (construção do emissário desde a nova Estação de Tratamento de Esgotos do AEROPORTO até o corpo receptor) decorrentes das obras de complementação da ampliação e reforma do Terminal de Passageiros (TPS) e obras complementares, obras externas ao AEROPORTO e integradas às obras do Sistema de Veículos Leves sobre Trilhos (VLT) e obras viárias complementares;
“c) o serviço de demolição, carga, transporte e descarga fora do AEROPORTO do entulho e nivelamento, das edificações da Vila Militar instalada no AEROPORTO. A Vila será transferida para outro imóvel como parte de processo administrativo próprio, a luz das legislações cabíveis, mediante autorização da autoridade competente;
“d) a demolição das edificações das concessões comerciais afetadas pelas obras do Sistema de Veículos Leves sobre Trilhos (VLT) e obras viárias complementares (inclusive as partes que fiquem fora da faixa de domínio dos sistemas viários), carga, transporte e descarga fora do AEROPORTO do entulho e nivelamento; 
“e) toda e qualquer indenização aos concessionários comerciais ativos da INFRAERO afetados pelas obras do Sistema de Veículos Leves sobre Trilhos (VLT) e obras viárias complementares, e a indenização dos lucros cessantes (se houver); e
“f) as novas calçadas e muros do AEROPORTO, nos trechos afetados pelas obras do Sistema de Veículos Leves sobre Trilhos (VLT) e obras viárias complementares, de acordo com as especificações fornecidas pela INFRAERO e legislação municipal cabível, por razões de segurança operacional e patrimonial do AEROPORTO.
“2.4.2.1 – A cessão, doação ou outra ação patrimonial referente às áreas indicadas no ANEXO 1 é objeto de processo administrativo próprio, formalizado em 14/11/12 com o Ofício nº696/GS/SECOPA/2012, e ainda em andamento.”

execução de obras do CORREDOR AEROPORTO / RODOFERROVIÁRIA abrangendo os seguintes serviços de engenharia civil:
1 - Construção do Viaduto Francisco H. dos Santos;
2 - Construção das alças de acesso ao Viaduto Francisco H. dos Santos;
3 - Reforma e ampliação da Av. Comendador Franco entre as Ruas Tenente Ricardo Kirch e Dr. Constante Coelho;
4 - Recuperação da Rua Comendador Franco entre as Ruas Maurício Nunes Garcia e a Linha Verde; 
5- Recuperação das Ruas Maurício Nunes Garcia (0=PP à est. 11 14,92) e Rua Tufik José Gueiros (est.12 8,4 a 16 0,00) e a 
6- Construção da trincheira na Rua Guabirotuba e alças.
Compreendendo os serviços de drenagem, pavimentação, sinalização horizontal e vertical, pontos de parada de ônibus, sinalização semafórica, calçamento, infra-estrutura de fibra ótica, obras de artes especiais(OAE), terraplenagem, remanejamento de interferências (redes de abastecimento de água e esgoto) e obras complementares.
